import React from "react"
import './item.css'
import { NavLink } from 'react-router-dom';


class Item extends React.Component{
  render() {
    return (
      <div className="menuitem">
        <NavLink className={this.props.cName} to={this.props.to}>
          <a>{this.props.name}</a>
        </NavLink>
      </div>
    )
  }
}
export default Item
